            "bisqEasy.tradeGuide.rules.content" to "- Before di exchange of account details between di seller and di buyer, any party fit cancel di trade without providing justification.\n- Traders suppose dey check dem trades regularly for new messages and must respond within 24 hours.\n- Once account details don dey exchanged, if you no meet trade obligations, e go be considered breach of di trade contract and fit result in ban from di Bisq network. Dis no apply if di trade peer no dey respond.\n- During Fiat payment, di buyer MUST NOT include terms like 'Bisq' or 'Bitcoin' for di 'reason for payment' field. Traders fit agree on one identifier, like random string wey be 'H3TJAPD', to associate di bank transfer with di trade.\n- If di trade no fit complete instantly because of longer Fiat transfer times, both traders must dey online at least once a day to monitor di trade progress.\n- If traders encounter unresolved issues, dem get di option to invite one mediator into di trade chat for assistance.\n\nIf you get any questions or need assistance, no hesitate to visit di chat rooms wey dey accessible under di 'Support' menu. Happy trading!",
