            "bisqEasy.walletGuide.createWallet.content" to "Bluewallet allow you to create several wallets for different purposes. For now, you just need one wallet. Once you enter Bluewallet, you go see message wey suggest make you add new wallet. Once you do that, enter name for your wallet and pick the option *Bitcoin* under the *Type* section. You fit leave all other options as dem dey and click on *Create*.\n\nWhen you move go next step, you go see 12 words. These 12 words na the backup wey allow you to recover your wallet if anything happen to your phone. Write them down for piece of paper (not digitally) for the same order as dem present am, store this paper safely and make sure only you get access to am. You fit read more about how to secure your wallet for the Learn sections of Bisq 2 wey dey dedicated to wallets and security.\n\nOnce you don finish, click on 'Ok, I wrote it down'.\nCongratulations! You don create your wallet! Make we move on to how to receive your bitcoin for am.",
